import React, { Component } from "react";

class FilteringOption extends Component {
  render() {
    const newStyle = {
      display: "none"
    };

    return (
      <label class="filtering" for="yes">
        <input
          type="radio"
          name="subscriber"
          value="yes"
          id="yes"
          onChange={this.props.filterList}
        />
        Yes
      </label>
    );
  }
}

export default FilteringOption;
